WCF.AdvancedAnnouncement={};WCF.AdvancedAnnouncement.Dismiss=Class.extend({_proxy:null,_container:null,init:function(e){this._container=e;this._proxy=new WCF.Action.Proxy({success:$.proxy(this._success,this)});this._container.each($.proxy(function(e,t){$(t).find(".aaclose").click($.proxy(this._click,this))},this))},_click:function(e){var t=$(e.target);var n=t.data("objectID");this._proxy.setOption("data",{actionName:"dismiss",className:"wcf\\data\\advancedannouncement\\AdvancedAnnouncementAction",objectIDs:[n]});this._proxy.sendRequest()},_success:function(e,t,n){$.each(e.objectIDs,function(e,t){$("#advancedAnnouncement"+t).fadeOut("slow")})}})